import React from "react";
import profilePic from "../assest/mnselfie.jpeg";

class Profile extends React.Component {
   myStyle = { width: "200px", height: "200px", borderRadius: "100px" };

  render() {
    return (
      <div>
        <img src={profilePic} style={this.myStyle} alt="profile Picture" />
        <h1>Hello</h1>
        <p>My name is Mansoor Gabali, I am a software engineer</p>
      </div>
    );
  }
}

export default Profile;
